            <xml-property name="queryText"><![CDATA[select distinct on (p.id) p.id,
facility.id as facilityId, facility.name as facilityName, 
p.details -> ''state'' ->> ''name'' as state, p.details -> ''province'' ->> ''name'' as province,
p.details ->> ''firstName'' as firstName, p.details ->> ''lastName'' as lastName, 
p.patient_number, p.details ->> ''dateRegistration'' as date_registration, 
p.details ->> ''dob'' as dob, EXTRACT(YEAR from AGE(NOW(), (p.details ->> ''dob'')::date)) as age,
p.details -> ''gender'' ->> ''display'' as gender, p.details -> ''maritalStatus'' ->> ''display'' as maritalStatus,
p.details -> ''education'' ->> ''display'' as education, p.details -> ''occupation'' ->> ''display'' as occupation,
p.details ->> ''street'' as address, p.details ->> ''mobilePhoneNumber'' as phoneNumber,
(dmoc_fd.data ->> ''date_devolved'')::timestamp as dateDevolved,
(dmoc_fd.data -> ''type_dmoc'' ->> ''display'') as typeDmoc,
(dmoc_fd.data -> ''type_scripting'' ->> ''display'') as monthsOfDispense,
(dmoc_fd.data -> ''viral_load_assessment'' ->> ''display'') as viralLoadAssessment,
(dmoc_fd.data -> ''cd4_assessed'' ->> ''display'') as cd4Assessed,
(dmoc_fd.data ->> ''date_last_viral_load'')::timestamp as dateLastViralLoad,
(dmoc_fd.data ->> ''date_last_cd4'') as dateLastCd4,
(dmoc_fd.data -> ''last_clinic_stage'' ->> ''display'') as lastClinicStage,
(dmoc_fd.data ->> ''date_last_clinic_stage'') as dateLastViralLoad,
(dmoc_fd.data -> ''regimen'' ->> ''name'') as dateLastViralLoad,
(dmoc_fd.data ->> ''date_next_refill'')::timestamp as dateNextRefill,
(dmoc_fd.data ->> ''date_next_clinic'')::timestamp as dateNextClinic,
(dmoc_fd.data ->> ''last_viral_load'') as lastViralLoad,
(dmoc_fd.data ->> ''last_cd4'') as lastCd4

from patient p
inner join organisation_unit facility on p.organisation_unit_id = facility.id

join encounter dmoc_enc on dmoc_enc.patient_id = p.id and dmoc_enc.form_code = ''d1477f0c-3320-4bfe-abac-d26388cb3b09''
left join form_data dmoc_fd on dmoc_fd.encounter_id = dmoc_enc.id

where p.organisation_unit_id = ?

order by p.id desc,
dmoc_fd.data ->> ''date_devolved'' desc]]></xml-property>
        </oda-data-set>
